import React from 'react';
import './App.css';
import { BrowserRouter as Router,  Route } from 'react-router-dom';

import HomePage from './components/homePage/HomePage';

function App() {
  return (
    <Router>
      <div className="app">
        <Route exact path="/"
        component={HomePage}>

        </Route>
      </div>
    </Router>
  );
}

export default App;
